import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const [matches, setMatches] = useState([]);
  const [loading, setLoading] = useState(true);
  const [fallbackImg, setFallbackImg] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchMatches = async () => {
      try {
        const res = await fetch('/api/live');
        const json = await res.json();

        const liveMatches = (json?.data || []).filter(
          m => m.matchStarted && !m.matchEnded && m.status !== 'Match not started'
        );

        setMatches(liveMatches.slice(0, 4));
      } catch (err) {
        console.error('Error fetching live matches:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchMatches();
  }, []);

  useEffect(() => {
    if (team.img && team.img.includes('h.cricapi.com')) {
      fetch('https://raw.githubusercontent.com/ashwint87/CricketAds/master/live_cricket_website_default_url')
        .then(res => res.text())
        .then(text => {
          try {
            // Extract the actual URL value from the text, e.g., url: 'https://...'
            const match = text.match(/url:\s*['"]([^'"]+)['"]/);
            if (match) setFallbackImg(match[1]);
          } catch (e) {
            console.error('Error parsing fallback URL:', e);
          }
        })
        .catch(err => console.error('Failed to fetch fallback image:', err));
    }
  }, [team.img]);

  if (loading) return <p>Loading live matches...</p>;
  if (!matches.length) return <p>No live matches found.</p>;

  return (
    <div className="home-container">
      <h2>Live Matches</h2>
      <div className="match-cards-row">
        {matches.map(match => (
          <div key={match.id} className="match-card" onClick={() => navigate(`/match/${match.id}`)} state={{ fromHome: true }}>
            <div className="series-line">
              <span>{match.seriesName}</span>
            </div>

            <div className="match-meta">
              <span>{match.name}</span>
            </div>

            <div className="match-meta">
              <span className="venue">{match.venue}</span>
            </div>

            {match.teamInfo?.map((team, idx) => {
               const innings = match.score?.filter(s => s.inning?.toLowerCase().includes(team.name.toLowerCase())) || [];
               return (
                 <div className="team-score-row" key={team.name}>
                   <div className="team-name">
                     <img
                       src={
                         team.img && team.img.includes('h.cricapi.com')
                           ? 'https://em-content.zobj.net/source/apple/354/white-flag_1f3f3-fe0f.png'
                           : team.img
                       }
                       alt={team.name}
                     />

                     <span>
                       {(team.name?.split(' ').length >= 3)
                         ? team.name.split(' ').map(w => w[0]).join('').toUpperCase()
                         : team.name.slice(0, 3).toUpperCase()}
                     </span>
                   </div>
                   <div className="score-text">
                     {innings.map((inn, i) => (
                       <span key={i}>
                         {inn.r}/{inn.w} ({inn.o})
                         {i < innings.length - 1 && ' & '}
                       </span>
                     ))}
                   </div>
                 </div>
               );
             })}

             <p className="status">{match.status}</p>

             {match.series_id && (
               <Link
                 to={`/series/${match.series_id}`}
                 className="series-link"
                 state={{ fromHome: true }}
                 onClick={(e) => e.stopPropagation()}
               >
                 {match.seriesName || 'Series'}
               </Link>
             )}
           </div>
      ))}
    </div>
  </div>
);
};

export default Home;
